def main():
    n = int(input())
    d = [int(x) for x in input().split()]
    line = [0] * n
    line[0] = 1
    for i in range(n - 1):
        line[d[i] + 1] = i + 2
    print(' '.join([str(x) for x in line]))

if __name__ == '__main__':
    main()

def main(n, d):
    result = [1]
    for i in d:
        result.insert(i, len(result) + 1)
    print(" ".join(map(str,result)))

if __name__ == "__main__":
    n = int(input())
    d = list(map(int, input().split(" ")))
    main(n,d)
